import React, { useState } from 'react';
import Video from './Video';
import './App.css';

function App() {
  const [videos, setVideos] = useState([]);

  {videos.map(({url, channel, description, likes, messages, shares, song}) => (
     <Video
      url={url}
      channel=""
      description ="wow this works"
      song="sonday monday"
      likes={111}
      messages={222}
      shares={333}
    />
  ))}

  return (
    <div className="app">
      <div className="app__videos">
        <Video
        url="https://www.tiktok.com/@scout2015/video/6718335390845095173"
        channel=""
        description ="wow this works"
        song="sonday monday"
        likes={111}
        messages={222}
        shares={333}
        />
        <Video />
        <Video />
        <Video />
      </div>
    </div>
  );
}

export default App;
